    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>overview: &#39;その場に居合わせた男女20名の筋肉が突如異常に発達し、ボディビルディングにおいて使用されるポージングを行い始めた。被影響者は連続してポージングを行いながら周囲を歩行し、他の被影響者と筋肉を見せ合うなどの行動をとった。目撃した民間人にはフラッシュモブとして認識されていた他、被影響者の筋肉に感銘を受ける様子を見せた民間人は同様の影響を受け、最終的な被影響者数は47名に上った。異常性発現から20分後、被影響者全員が泣き始め、一様に「違う！ これは神に賜った筋肉ではない！」と叫び、同時に消失した。&#39;
